import { useState, useEffect } from 'react'
import { Link } from 'react-router-dom'
import ItemListComponent from '../components/ItemList/ItemListComponent'

const ListResults = ({textToSearch}) => {

  const [data, setData] = useState([])

  const getData = async () => {
    const url = `http://localhost:3000/items?q=${textToSearch}`
    const data = await fetch(url)
      .then(res => res.json())
      .then(data => data)
      .catch(err => err)
      return data;
  }

  useEffect(() => {
    getData().then(data => setData(data.data)).catch(err => console.log(err))
  }, [])
  

  return (
    <div>
      <h1>Lista de resultados</h1>
      <div className='row'>
        <div className='col-md-12'>
          {
            data?.map((item, index) => (
              <div key={index} className='col-md-3'>
                <Link to={`/items/${item.id}`}>
                  <ItemListComponent data={item} />
                </Link>
              </div>
            ))
          }

        </div>
      </div>
    </div>
  )
}

export default ListResults
